        // Form submission
        document.getElementById('reservationForm').addEventListener('submit', async function(e) {
            e.preventDefault();
            
            // Get form data
            const name = document.getElementById('name').value;
            const email = document.getElementById('email').value;
            const phone = document.getElementById('phone').value;
            const date = document.getElementById('date').value;
            const time = document.getElementById('time').value;
            let guests = document.getElementById('guests').value;
            const message = document.getElementById('message').value;
            
            // Handle custom guests
            if (guests === 'custom') {
                guests = document.getElementById('customGuests').value;
                if (!guests || guests < 1) {
                    showMessage('Please enter a valid number of guests', 'error');
                    return;
                }
            }
            
            // Validate date (not in the past)
            const selectedDate = new Date(date);
            const today = new Date();
            today.setHours(0, 0, 0, 0);
            
            if (selectedDate < today) {
                showMessage('Please select a future date', 'error');
                return;
            }
            
            // Show loading
            document.getElementById('loading').style.display = 'block';
            document.getElementById('submitBtn').disabled = true;
            
            // Prepare data
            const formData = {
                name: name,
                email: email,
                phone: phone,
                date: date,
                time: time,
                guests: guests,
                message: message,
                timestamp: new Date().toISOString()
            };
            
            try {
                // Send to backend API
                const response = await fetch('/api/reservation', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                    },
                    body: JSON.stringify(formData)
                });
                
                const result = await response.json();
                
                if (response.ok) {
                    // Success
                    showMessage(`Thank you ${name}! Your reservation has been submitted. A confirmation email has been sent to ${email}`, 'success');
                    document.getElementById('reservationForm').reset();
                    document.getElementById('customGuestDiv').style.display = 'none';
                } else {
                    // Error from server
                    showMessage(result.error || 'Failed to submit reservation. Please try again.', 'error');
                }
            } catch (error) {
                // Network error
                console.error('Error:', error);
                showMessage('Network error. Please check your connection and try again.', 'error');
            } finally {
                // Hide loading
                document.getElementById('loading').style.display = 'none';
                document.getElementById('submitBtn').disabled = false;
            }
        });
        
        // Function to show messages
        function showMessage(text, type) {
            const messageContainer = document.getElementById('messageContainer');
            messageContainer.textContent = text;
            messageContainer.className = type;
            messageContainer.style.display = 'block';
            
            // Auto-hide after 10 seconds for success, 5 for error
            setTimeout(() => {
                if (messageContainer.style.display === 'block') {
                    messageContainer.style.display = 'none';
                }
            }, type === 'success' ? 10000 : 5000);
        }
        
        // Set minimum date to today
        const today = new Date().toISOString().split('T')[0];
        document.getElementById('date').min = today;
        
        // Set default time to next hour
        const nextHour = new Date();
        nextHour.setHours(nextHour.getHours() + 1);
        document.getElementById('time').value = nextHour.toTimeString().substring(0, 5);
