        // Scroll Reveal Animation
        window.addEventListener('scroll', revealOnScroll);

        function revealOnScroll() {
            const sections = document.querySelectorAll('.section');
            
            sections.forEach(section => {
                const sectionTop = section.getBoundingClientRect().top;
                const windowHeight = window.innerHeight;
                
                if (sectionTop < windowHeight - 100) {
                    section.style.opacity = '1';
                    section.style.transform = 'translateY(0)';
                }
            });
        }

        let zoomedImg = null;
let overlay = null;

function expandImage(original) {
    // If already zoomed, close it
    if (zoomedImg) {
        closeZoom();
        return;
    }

    // Create overlay
    overlay = document.createElement('div');
    overlay.className = 'image-overlay';
    overlay.onclick = closeZoom;
    document.body.appendChild(overlay);

    // Duplicate image
    zoomedImg = original.cloneNode(true);
    zoomedImg.classList.add('zoomed-image');
    document.body.appendChild(zoomedImg);

    // Position cloned image over original
    const rect = original.getBoundingClientRect();
    zoomedImg.style.left = rect.left + "px";
    zoomedImg.style.top = rect.top + "px";

    // Animate to expanded size
    setTimeout(() => {
        zoomedImg.classList.add('active');
    }, 10);
}

function closeZoom() {
    if (!zoomedImg) return;

    zoomedImg.remove();
    overlay.remove();
    zoomedImg = null;
    overlay = null;
}


